export const BASE_URL = 'https://auth.nomoreparties.co';
export default function register(email, password){
    return fetch(`${BASE_URL}/signup`, {
        method: 'POST',
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
            "email": email,
            "password": password
        })
    })
    .then(res => res.json())
    .then(res => res)
    .catch(e => console.log(e))

}
